import { useEffect, useState } from "react";
import { fetchImages } from "./api";

function Loading() {
  return <p>Loading...</p>;
}

function Header() {
    return (
      <header className="hero is-dark is-bold">
        <div className="hero-body">
          <div className="container">
            <h1 className="title">Cute Dog Images</h1>
          </div>
        </div>
      </header>
    );
  }

  function Image(props) {
    return (
      <div className="card">
        <div className="card-image">
          <figure className="image">
            <img src={props.src} alt="cute dog!" />
          </figure>
        </div>
      </div>
    );
  }

  function Gallery(props) {
    const { urls } = props;
    if (urls == null) {
      return <Loading />;
    }
    return (
      <div className="columns is-vcentered is-multiline">
        {urls.map((url) => {
            return (
            <div key={url} className="column is-3">
                <Image src={url} />
            </div>
            );
        })}
      </div>
    );
  }

// function Gallery() {
//     const images = [
//       <div
//         key="https://images.dog.ceo/breeds/shiba/shiba-11.jpg"
//         className="column is-3"
//       >
//         <Image src="https://images.dog.ceo/breeds/shiba/shiba-11.jpg" />
//       </div>,
//       <div
//         key="https://images.dog.ceo/breeds/shiba/shiba-12.jpg"
//         className="column is-3"
//       >
//         <Image src="https://images.dog.ceo/breeds/shiba/shiba-12.jpg" />
//       </div>,
//       //...
//     ];
//     return <div className="columns is-vcentered is-multiline">{images}</div>;
//   }

  function Calc() {
    const x = 6;
    const y = 7;
    return (
      <p>
        {x} * {y} = {x * y}
      </p>
    );
  }

  function Form(props) {
    function handleSubmit(event) {
      event.preventDefault();
      const { breed } = event.target.elements;
      props.onFormSubmit(breed.value);
    }
    return (
      <div>
        <form onSubmit={handleSubmit}>
          <div className="field has-addons">
            <div className="control is-expanded">
